import React from 'react';

const Item = ({item}) => {
    const {id, title, desc, category, price, img} = item
    return (
        <>
            <div className='item'>
                <div className="img"><img src={img} alt={title}/></div>
                <h3>{title}</h3>
                <p>{desc}</p>
                <b>{price}$</b>
                <div className='add_to_cart'>+</div>
            </div>
        </>
    );
};

export default Item;
